con:config.script:
import com.eviware.soapui.support.XmlHolder

//To get item name from response of GetProductTypes service 
def item = context.expand('${GetProductTypes#Response#//name}')
// To provide item name on CreateProduct Service request 
def createReq = testRunner.testCase.getTestStepByName('CreateProduct').getPropertyValue("Request")
def create = new XmlHolder(createReq);
create.setNodeValue("//sku", "SKU00010")
create.setNodeValue("//name", "iPhone16")
create.setNodeValue("//attributeSetId", 4)
create.setNodeValue("//typeId", item)
//save the request with value
def newxml1 = create.getXml();
//update the request 
testRunner.testCase.getTestStepByName('CreateProduct').setPropertyValue("Request", newxml1)

con:configuration.scriptText:
import com.eviware.soapui.support.XmlHolder

def holder = new XmlHolder(messageExchange.responseContentAsXml) //to get response from Xml file

def skuValue = holder.getNodeValue("//sku")

//log.info skuValue

context.testCase.setPropertyValue("sku", skuValue)

con:config.script:
import com.eviware.soapui.model.testsuite.TestRunner.Status

//From here i want to be execute property expansion login and logout 

def tc = testRunner.testCase.testSuite.testCases["Manual_End to End Flow"]

//Set the value for property from the script itself
tc.testSteps["AllProperties"].setPropertyValue("sku", "SKU00021")
tc.testSteps["AllProperties"].setPropertyValue("name", "iPhone711")
tc.testSteps["AllProperties"].setPropertyValue("typeId", "simple")

//run using synchronously 

def runner = tc.run(null,false)

//Log the result of the execution 

log.info "Status : $runner.status, time Taken for test case: $runner.timeTaken ms"
log.info "Number of test step which got executed: " +runner.results.size()

//assert
assert runner.status != Status.FAILED : runner.reason

assert runner.results.size()==7
